import React from 'react';
import { Link } from 'react-router-dom';
import './styles/MainMenu.css';  // Import MainMenu styles

function MainMenu() {
  return (
    <div className="main-menu">
      <h2>Welcome to the Main Menu</h2>
      <Link to="/leaderboard">
        <button className="leaderboard-btn">Leaderboard</button>
      </Link>
      <Link to="/game">
        <button className="play-btn">Play Game</button>
      </Link>
    </div>
  );
}

export default MainMenu;
